const Cv = ({tasks}) => {


  return (
    <>
    <div key={tasks.count} >
        <div className='name' >
            {tasks.text}
            </div>
            <div className='name'>
            {tasks.tel}
            </div>
            <div className='name'>
            {tasks.email} and {tasks.date}
            </div>
    </div>


    </>
  );
};

export default Cv;
